INSERT INTO `tblconvocatoria` VALUES (1,1,'Posgrados de la Facultad de Química\r\n','2024','<h1>C O N V O C A T O R I A</h1>\r\n<h2>POSGRADOS DE QU&Iacute;MICA</h2>\r\n<h2>PROCESO DE SELECCI&Oacute;N 2024-01</h2>\r\n<p>La Facultad de Qu&iacute;mica de la <strong>UAQ</strong>, convoca al proceso de selecci&oacute;n 2024-01.</p>\r\n<p><strong>Convocatoria:</strong></p>\r\n<p><strong>https://quimica.uaq.mx/convocatoriaposgrado</strong></p>\r\n<h3><strong>MAYOR INFORMACI&Oacute;N</strong></h3>\r\n<p>Jefatura de Investigaci&oacute;n y Posgrado,<br />Facultad de Qu&iacute;mica,<br />Cerro de las campanas s/n C.P. 76010, Quer&eacute;taro, Qro, M&eacute;xico.<br />Tel. 01 (442) 1 92 12 00 ext. 5568, 5555 y 5529.<br />Horario de atenci&oacute;n 9:00am a 15:30 hrs</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2>&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Para completar tu registro como aspitante deber&aacute;s presentar la documentaci&oacute;n de la convocatoria.</p>\r\n<p>Contacta a la asistente del programa para dudas o aclaraciones:</p>\r\n<p>&nbsp;<strong>Mar&iacute;a del Carmen Campos P&eacute;rez</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5568</p>\r\n<p>pcampos@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Especialidad en Inocuidad de Alimentos</li>\r\n<li>Maestr&iacute;a en Ciencia y Tecnolog&iacute;a de Alimentos</li>\r\n<li>Doctorado en Ciencias de los Alimentos</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nathaly Gonz&aacute;lez Miranda</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5555</p>\r\n<p>nathaly.gonzalez@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Maestr&iacute;a en Ciencias de la Energ&iacute;a</li>\r\n<li>Maestr&iacute;a en Ciencia y Tecnolog&iacute;a Ambiental</li>\r\n<li>Doctorado en Ciencias de la Energ&iacute;a</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Arlette Torres L&oacute;pez</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5560</p>\r\n<p>sarlet@uaq.mx</p>\r\n<p>Oficina de Jefatura de Investigaci&oacute;n y Posgrado</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Miryam Iz&eacute;bel Moreno Pacheco</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5529</p>\r\n<p>miryam.moreno@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Especialidad en Bioqu&iacute;mica Cl&iacute;nica</li>\r\n<li>Maestr&iacute;a en Qu&iacute;mica Cl&iacute;nica Diagn&oacute;stica</li>\r\n<li>Maestr&iacute;a en Ciencias Qu&iacute;mico Biol&oacute;gicas</li>\r\n<li>Doctorado en Ciencias Qu&iacute;mico Biol&oacute;gicas</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Estimado aspirante:</p>\r\n<p>Has completado el env&iacute;o de los documentos electr&oacute;nicos.</p>\r\n<p>Deber&aacute;s estar atento a la p&aacute;gina web de la Facultad y de tu correo electr&oacute;nico, para visualizar avisos de haberlos.</p>\r\n<p>Contacta a la asistente del programa para dudas o aclaraciones:</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Mar&iacute;a del Carmen Campos P&eacute;rez</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5568</p>\r\n<p>pcampos@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Especialidad en Inocuidad de Alimentos</li>\r\n<li>Maestr&iacute;a en Ciencia y Tecnolog&iacute;a de Alimentos</li>\r\n<li>Doctorado en Ciencias de los Alimentos</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nathaly Gonz&aacute;lez Miranda</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5555</p>\r\n<p>nathaly.gonzalez@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Maestr&iacute;a en Ciencias de la Energ&iacute;a</li>\r\n<li>Maestr&iacute;a en Ciencia y Tecnolog&iacute;a Ambiental</li>\r\n<li>Doctorado en Ciencias de la Energ&iacute;a</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Arlette Torres L&oacute;pez</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5560</p>\r\n<p>sarlet@uaq.mx</p>\r\n<p>Oficina de Jefatura de Investigaci&oacute;n y Posgrado</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Miryam Iz&eacute;bel Moreno Pacheco</strong></p>\r\n<p>Tel: 1921200</p>\r\n<p>Ext 5529</p>\r\n<p>miryam.moreno@uaq.mx</p>\r\n<p>Programas:</p>\r\n<ul>\r\n<li>Especialidad en Bioqu&iacute;mica Cl&iacute;nica</li>\r\n<li>Maestr&iacute;a en Qu&iacute;mica Cl&iacute;nica Diagn&oacute;stica</li>\r\n<li>Maestr&iacute;a en Ciencias Qu&iacute;mico Biol&oacute;gicas</li>\r\n<li>Doctorado en Ciencias Qu&iacute;mico Biol&oacute;gicas</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>');
